import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root',
})
export class Announcement {
  private allAnnoncment=[
    {owner:"123",title:"BMW serie 7",content:"BMW serie 7 description",image:"data:image/jpeg;base64,",price:"300 mille dinars", category:"auto"},
    {owner:"321",title:"phone",content:"phone description",image:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTWe0g1RKBvNrXLJBYtaMxV6LrfTqGDn86rainrsRWkgh9G6Qce8fJBygLn2sndoJVglxg&usqp=CAU",price:"800 dinars",category:"electronic"},
    {owner:"123",title:"Mercedes-Benz AMG G63",content:"Mercedes-Benz AMG G63 description",image:"data:image/jpeg;base64,",price:"500 mille dinars", category:"auto"},
    {owner:"789",title:"Golf 6",content:"Golf 6 description",image:"https://www.largus.fr/images/images/Volkswagen-Golf-VI.jpg",price:"40000 dinars",category:"auto"},
    {owner:"654",title:"laptop",content:"laptop description ",image:"https://www.cnet.com/a/img/resize/468ea42b69875136295b704ea9b0ed459612de62/hub/2022/04/27/b796792b-5b34-4405-83eb-efc66371ee06/samsung-galaxy-book-2-pro-360-01.jpg?auto=webp&fit=crop&height=675&width=1200",price:"4000 dinars",category:"electronic"}
    ]
    categoryAnnouncment=[]
  constructor() {}
  addAnnouncment(announcment) {
    this.allAnnoncment.push(announcment);
  }

  getAllAnnouncement() {
    return this.allAnnoncment;
  }

  getAnnouncementByCategory(category) {
    this.categoryAnnouncment=[]
    this.allAnnoncment.forEach(element => {
      console.log(element.category+ "||||"+ category);
      
      if (element.category==category) {
        this.categoryAnnouncment.push(element)
      }
    });
    
    return this.categoryAnnouncment;
  }


}
